import Button from '@mui/material/Button';
import { styled } from '@mui/system';

const LongButton = styled(Button)(({ theme }) =>({
    marginTop: "20px",
    width: "280px",
    padding: '10px',
    backgroundColor: theme.palette.primary,
    color: theme.palette.white,
}));

export default LongButton;
